document.addEventListener("DOMContentLoaded",()=>{const c=document.getElementsByClassName("rating-bar");for(let d,e=0;e<c.length;e++){d=Math.round(c[e].dataset.rating);for(let a=0;a<c[e].children.length;a++)a<d&&c[e].children[a].classList.add("active")}});